    "# Calculating annualized Sharpe Ratios\n",
    "jpr_sharpe_ratios = ((jpr_with_rf_rate.mean()-jpr_with_rf_rate['rf_rate'].mean()) * 252) / (jpr_with_rf_rate.std() * np.sqrt(252))\n",
